<template>
	<text :style="{ color: color, fontSize: size + unit, fontWeight: fontWeight}" class="fui-icon"
		@click="handleClick">{{ icons[name] }}</text>
</template>

<script>
	import icons from './fui-icon.js';
	// #ifdef APP-NVUE
	var domModule = weex.requireModule('dom');
	domModule.addRule('fontFace', {
		'fontFamily': 'fuiFont',
		'src': "url('data:font/truetype;charset=utf-8;base64,')"
	});
	// #endif
	export default {
		name: "fui-icon",
		props: {
			name: {
				type: String,
				default: ''
			},
			size: {
				type: [Number, String],
				default:64
			},
			//rpx | px
			unit: {
				type: String,
				default: 'rpx'
			},
			color: {
				type: String,
				default: '#333333'
			},
			//字重
			fontWeight: {
				type: [Number, String],
				default: 'normal'
			},
			params: {
				type: [Number, String],
				default: 0
			}
		},
		data() {
			return {
				icons: icons
			};
		},
		methods: {
			handleClick() {
				this.$emit('click', {
					params: this.params
				});
			}
		}
	}
</script>

<style>
	/* #ifndef APP-NVUE */
	/* 头条小程序组件内不能引入字体，需要在父级页面引入字体文件*/
	@font-face {
	    font-family: 'fuiFont';
	    src: url("./fui-icon.ttf") format("truetype");
	}

	/* #endif */
	.fui-icon {
		font-family: fuiFont;
		text-decoration: none;
		text-align: center;
		/* #ifdef H5 */
		cursor: pointer;
		/* #endif */
	}
</style>
